    save(payload) {
        console.log("clicked");
        console.log(payload);
        this.SpinnerService.show();
        if (this.editFlag == false) {
            this.videoStreamService
                .createVideos(payload, this.selectedVideoType)
                .subscribe((response) => {
                this.dialog.open(this.created);
                this.router.navigate(['/admin/video-stream']);
                this.SpinnerService.hide();
            }, (error) => {
                console.log('Error : ', error);
                this.dialog.open(this.error);
                this.SpinnerService.hide();
            });
        }
        else {
            this.videoStreamService
                .updateVideo(this.videoId, payload, this.selectedVideoType)
                .subscribe((response) => {
                //  // ;
                this.dialog.open(this.updated);
                this.router.navigate(['/admin/video-stream']);
                this.SpinnerService.hide();
            }, (error) => {
                console.log('Error : ', error);
                this.dialog.open(this.error);
                this.SpinnerService.hide();
            });
        }
    }
    changeVideoType(event) {
        this.imgs = [];
        this.videos = [];
        this.imgURL = [];
        this.videoURLS = [];
        this.selectedVideoType = event.target.value;
        switch (this.selectedVideoType) {
            case 'liveVideo': {
                this.liveSessionForm.reset();
                this.liveSessionForm.patchValue({
                    storeId: this.storeId,
                    type: 'liveVideo',
                    daySlots: '15 Min',
                    scheduleRepeats: 'Daily'
                });
                break;
            }
            case 'packageVideo': {
                this.packageSessionForm.reset();
                this.packageSessionForm.patchValue({
                    storeId: this.storeId,
                    rtype: 'precordedVideo',
                    ltype: 'pliveVideo',
                    type: 'packageVideo',
                    ptype: 'packageVideo',
                    daySlots: '15 Min',
                    scheduleRepeats: 'Daily'
                });
                break;
            }
            default: {
                this.recordedVideoForm.reset();
                this.recordedVideoForm.patchValue({
                    storeId: this.storeId,
                    type: 'pliveVideo',
                });
                break;
            }
        }
    }
